import React from 'react';
import { Canvas } from 'react-three-fiber';

function Box() {
  return (
    <mesh> 
      <boxBufferGeometry attach="geometry" />
      <meshLambertMaterial attach="material" color="black"/>
    </mesh>
  )


}




export default function App() {
  return ( 
    <Canvas>
      <Box />
    </Canvas> 
  )
}
